function functionName(config, params, result)
{
	let maxFreeChapter = 99999;
	if(result.book.free!=1){
		maxFreeChapter = result.book.maxfreechapter;
		if(maxFreeChapter==0)
			maxFreeChapter = 99999;
	}

	let lastChapter = result.book.lastChapter;
	let lastSeq = 0;

	let newList = [];
	let oldList = result.chapter;
	let len = oldList.length;
	for(let i=0; i<len; i++)
	{
		lastSeq = oldList[i].seq;
		if(lastSeq>maxFreeChapter)
			break;

		let cp = {};
		cp.title = oldList[i].title;
		cp.url = 'bid=' + params.queryInfo.detailUrl + '&cid=' + lastSeq;
		newList.push(cp);
	}

	let back = {'list':newList, 'updateTime':result.book.updateDate};

	if(maxFreeChapter>lastSeq && lastChapter>lastSeq){
		back.autoRequestMore = true;
		back.more = true;
		back.nextPageUrl = params.queryInfo.detailUrl;
	}

	return back;
}

