chapterList.JSParser:
function functionName(config, params, resObj)
{
	var result = {};
	if(resObj.data && resObj.data.vs && resObj.data.vs.length>0)
	{
		var list = [];
		let updateTime = undefined;

		var groupList = resObj.data.vs;
		var groupLength = groupList.length;
		for(let i=0; i<groupLength; i++)
		{
			// check vip
			let vs = groupList[i].vS;
			if(vs && vs==1)
				continue;

			let itemList = groupList[i].cs;
			let itemLength = itemList.length;
			for(let j=0; j<itemLength; ++j)
			{
				let chapter = {};
				chapter.title = itemList[j].cN;
				chapter.url = itemList[j].cU;
				list.push(chapter);

				if(j==itemLength-1)
					updateTime = itemList[j].uT;
			}
		}

		result.list = list;
		if(updateTime)
			result.updateTime = updateTime;	}

	if(resObj.msg && resObj.msg=='suc')
		result.success = true;
	return result;
}

